INSERT INTO `ebook` VALUES (9,'Robin HOBB','1995-02-01','Pygmalion',2,4,37,'24',55,'thropherima','Au royaume des six Duch&amp;eacute;s, le prince Chevalerie, de la famille r&amp;eacute;gnante des Loinvoyant - par tradition, le nom des seigneurs doit modeler leur caract&amp;egrave;re- d&amp;eacute;cide de renoncer &amp;agrave; son ambition de devenir roi-servant en apprenant l\\\'existence de Fitz, son fils ill&amp;eacute;gitime. Le jeune b&amp;acirc;tard grandit &amp;agrave; Castelcerf, sous l\\\'&amp;eacute;gide du ma&amp;icirc;tre d\\\'&amp;eacute;curie Burrich. Mais le roi Subtil impose bient&amp;ocirc;t que FITZ re&amp;ccedil;oive, malgr&amp;eacute; sa condition, une &amp;eacute;ducation princi&amp;egrave;re. L\\\' enfant d&amp;eacute;couvrira vite que le v&amp;eacute;ritable dessein du monarque est autre : faire de lui un assassin royal.\\\\r\\\\nEt tandis que les attaques des pirates rouges mettent en p&amp;eacute;ril la contr&amp;eacute;e, Fitz va constater &amp;agrave; chaque instant que sa vie ne tient qu\\\'&amp;agrave; un fil : celui de sa lame...','Assassin Royal','fr'),(10,'Robin HOBB','1996-01-05','Pygmalion',2,4,38,'25',57,'thropherima','Fitz, le b&acirc;tard royal, a surve&ccedil;u &agrave; sa premi&egrave;re mission meurtri&egrave;re, mais con contact avec la mort lui a laiss&eacute; d\\\'inalt&eacute;rables s&eacute;quelles.Revenu &agrave; Castelcerf, il retrouve celle qu\\\'il a aim&eacute;e, mais il ne peut lui d&eacute;clarer sa flamme sous peine de la condamner irr&eacute;m&eacute;diablement. Car, autour de lui, la Cour fourmille d\\\'intrigues, les menaces se resserrent, la mort r&ocirc;de.Il a pourtant quelques alli&eacute;s dans la place : un prince qui lui fait d&eacute;couvrir les myst&egrave;res d\\\'une magie toute-puissante, un ma&icirc;tre assassin qui lui veut malgr&eacute; tout du bien, et un loup, avec qu\\\'il partage un lien &eacute;trange et p&eacute;rilleux&hellip;Avec un art consomm&eacute; du suspense et cette connaissance du c&oelig;ur humain dont elle a le secret, Robin Hobb nous plonge une nouvelle fois dans une extraordinaire et merveilleuse aventure situ&eacute;e tr&egrave;s loin du monde o&ugrave; nous vivons, mais que nous sentons pourtant tr&egrave;s proche de nous par son intimit&eacute; et irr&eacute;sistible universalit&eacute;','','fr'),(11,'Christopher Paolini','2012-10-05','Bayard ',2,4,39,'26',59,'thropherima','Not so very long ago, Eragon&amp;mdash;Shadeslayer, Dragon Rider&amp;mdash;was nothing more than a poor farm boy, and his dragon, Saphira, only a blue stone in the forest. Now the fate of an entire civilization rests on their shoulders.\\\\r\\\\n\\\\r\\\\nLong months of training and battle have brought victories and hope, but they have also brought heartbreaking loss. And still, the real battle lies ahead: they must confront Galbatorix. When they do, they will have to be strong enough to defeat him. And if they cannot, no one can. There will be no second chances. \\\\r\\\\n\\\\r\\\\nThe Rider and his dragon have come further than anyone dared to hope. But can they topple the evil king and restore justice to Alaga&amp;euml;sia? And if so, at what cost?\\\\r\\\\n\\\\r\\\\nThis is the much-anticipated, astonishing conclusion to the worldwide bestselling Inheritance cycle.','The Inheritance Cycle','uk'),(12,'Christopher Paolini','2004-10-21','Alfred A. Knopf',2,4,41,'27',63,'severus','Eragon, a young farm boy, finds a marvelous blue stone in a mystical mountain place. Before he can trade it for food to get his family through the hard winter, it hatches a beautiful sapphire-blue dragon, a race thought to be extinct. Eragon bonds with the dragon, and when his family is killed by the marauding Ra\\\'zac, he discovers that he is the last of the Dragon Riders, fated to play a decisive part in the coming war between the human but hidden Varden, dwarves, elves, the diabolical Shades and their neanderthal Urgalls, all pitted against and allied with each other and the evil King Galbatorix. Eragon and his dragon Saphira set out to find their role, growing in magic power and understanding of the complex political situation as they endure perilous travels and sudden battles, dire wounds, capture and escape.','Inheritance Cycle','uk'),(13,'Christopher Paolini','2005-08-23','Alfred A. Knopf',2,4,43,'28',65,'severus','The land of Alagaesia is suffering under the Empire of the wicked Galbatorix, and Eragon and his dragon Saphira, last of the Riders, are the only hope. But Eragon is young and has much to learn, and so he is sent off to the elven forest city of Ellesmera, where he and Saphira are tutored in magic, battle skills, and the ancient language by the wise former Rider Oromis and his elderly dragon Glaedr. Meanwhile, back at Carvahall, Eragon\\\'s home, his cousin Roran is the target of a siege by the hideous Ra\\\'zac, and he must lead the villagers on a desperate escape over the mountains. The two narratives move toward a massive battle with the forces of Galbatorix, where Eragon learns a shocking secret about his parentage and commits himself to saving his people.','The Inheritance Cycle','uk'),(14,'Christopher Paolini','2008-09-20','Alfred A. Knopf',2,4,44,'29',67,'severus','Oaths sworn . . . loyalties tested . . . forces collide.\\r\\n\\r\\nIt\\\'s been only months since Eragon first uttered \\\"brisingr,\\\" the ancient language term for fire. Since then, he\\\'s not only learned to create magic with words-he\\\'s been challenged to his very core. Following the colossal battle against the Empire\\\'s warriors on the Burning Plains, Eragon and his dragon, Saphira, have narrowly escaped with their lives. Still, there is more adventure at hand for the Rider and his dragon, as Eragon finds himself bound by a tangle of promises he may not be able to keep.\\r\\n\\r\\nFirst is Eragon\\\'s oath to his cousin, Roran: to help rescue Roran\\\'s beloved from King Galbatorix\\\'s clutches. But Eragon owes his loyalty to others, too. The Varden are in desperate need of his talents and strength-as are the elves and dwarves. When unrest claims the rebels and danger strikes from every corner, Eragon must make choices-choices that will take him across the Empire and beyond, choices that may lead to unimagined sacrifice.\\r\\n\\r\\nEragon is the greatest hope to rid the land of tyranny. Can this once simple farm boy unite the rebel forces and defeat the king?','The Inheritance Cycle','uk'),(15,'J.R.R Tolkien','1969-04-02','Allen &amp; Unwin',2,4,46,'30',69,'severus','The Hobbit is the unforgettable story of Bilbo, a peace-loving hobbit, who embarks on a strange and magical adventure.A timeless classic.Bilbo Baggins enjoys a quiet and contented life, with no desire to travel far from the comforts of home; then one day the wizard Gandalf and a band of dwarves arrive unexpectedly and enlist his services &ndash; as a burglar &ndash; on a dangerous expedition to raid the treasure-hoard of Smaug the dragon. Bilbo&rsquo;s life is never to be the same again.Seldom has any book been so widely read and loved as J.R.R. Tolkien&rsquo;s classic tale, &lsquo;The Hobbit&rsquo;. Since its first publication in 1937 it has remained in print to delight each new generation of readers all over the world, and its hero, Bilbo Baggins, has taken his place among the ranks of the immortals of fiction.','','uk'),(16,'qsdfqsdf','2013-05-14','qsdfqsdf',2,5,56,'31',89,'severus','qsdfqsdf','qsdfqsdf','uk'),(17,'qsdfqsdfqsdfqsdf','2013-05-16','sdfqsdfqs',2,5,57,'32',91,'severus','qsdfqsdffdf5fsdqfsdsff_\\\"&amp;egrave;q sdf&amp;egrave;qsdf&amp;egrave;qsdfqsdf&amp;egrave;qdsfqsdfdsf&amp;ocirc;&amp;ocirc;&amp;ocirc;&amp;ocirc;&amp;ocirc;&amp;ocirc;&amp;ocirc;','fqsdfqsdfqsd','it'),(18,'qsdfqsdfqsdf','2013-05-22','qsdfqsdf',2,5,58,'33',93,'severus','qsdfqsdfqsdfqsdfl&amp;eacute;trolllre &amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;eacute;&amp;ea