INSERT INTO `software` VALUES (1,9,'2013-03-28','AutoCAD est un logiciel de dessin assist&eacute; par ordinateur (DAO) cr&eacute;&eacute; en d&eacute;cembre 1982 par Autodesk.\\r\\n\\r\\nEn 2011, AutoCAD est d&eacute;velopp&eacute; pour Windows et pour Mac OS X. AutoCAD n\\\'a pas exist&eacute; que sur Windows. En effet, des versions Mac existaient avant 1992, date &agrave; laquelle l\\\'&eacute;diteur Autodesk abandonna la plateforme Mac. Le 1er septembre 2010, l\\\'&eacute;diteur Autodesk annonce le retour d\\\'AutoCAD sur Mac, livrable fin 20102.','Autodesk',1,53,0,83,'Propri&egrave;taire','severus',1,'2014','fr'),(2,9,'2013-06-04','azrazer','razeraze',2,133,0,227,'azerazeaezr','severus',5,'12.01.1','uk');
